import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './header.css';
import '@fortawesome/free-solid-svg-icons'


const Header = () => {
    return (
        <>
        <div class="flex items-center pt-4 pb-4 flex-wrap w-full custom-background fixed z-10">
            <div class="sm:flex global">
                <span class="text" onClick={() => window.location.reload()}>Where in the world?</span>
            </div>
        </div>
        </>

    )
}

export default Header;
